//Яндекс-карты
(function() {

$(document).ready(function () {

    let YandexMaps = function () {
        ymaps.ready(init); //ждем загрузки api и DOM после чего запускаем функцию init

        var placemarks = []; // Массив объектов который мы перебираем методом forEach
        
        let obj = {
            latitude: .0, //широта
            longitude: .0, //долгота
            hintContent: '', //текст подсказки
            balloonContent: [ //текст балуна
                '<div class="map__balloon">',
                '<img class="map__burger-img" src="./img/hero/burger.png" alt="Бургер"/>',
                '',
                '</div>'
            ]
        };

        //запрос json-данных у сервера, методом GET, без перезагрузки страницы
        let getMarks = function () {
            let jqxhr = $.getJSON("./JSON/placemarks.JSON", function (data) {

                 $.each(data, function (key, value) { 
                    obj = {
                        latitude: value[0], //широта
                        longitude: value[1], //долгота
                        hintContent: value[2], //текст подсказки
                        balloonContent: [ //текст балуна
                            '<div class="map__balloon">',
                            '<img class="map__burger-img" src="./img/hero/burger.png" alt="Бургер"/>',
                            value[3],
                            '</div>'
                        ]
                    };
                    placemarks.push(obj);
                });                 
            });
        };
        getMarks();        
                
        /*Инициализация функции создания карты и добавление на карту placemark*/
        function init() {
            var map = new ymaps.Map("map", {
                center: [55.39337183, 43.81580401],
                zoom: 17,
                controls: ["zoomControl"], // Выводим только кнопки зума
                behaviors: ["drag"]
            });
            placemarks.forEach(function (item) {
                
                var placemark = new ymaps.Placemark(
                    [item.latitude, item.longitude],
                    {
                        hintContent: item.hintContent,
                        balloonContent: item.balloonContent.join("")
                    },
                    {
                        iconLayout: "default#image",
                        iconImageHref: "./img/contacts/map-marker.svg",
                        iconImageSize: [46, 58],
                        iconImageOffset: [-23, -58]
                        // iconImageHref: "img/sprite.png",
                        // iconImageSize: [46, 57],
                        // iconImageOffset: [-23, -57],
                        // iconImageClipRect: [[415, 0], [461, 57]]
                    });
                map.geoObjects.add(placemark);
            })
        }
    };
    YandexMaps();
});
})();
//вертикальный аккордеон
let VerticalAccordeon = function () {
    const menulist = document.querySelector('.menu__list');
    const menuitems = document.querySelectorAll('.menu__item');

    menulist.addEventListener('click', e => {
        let target = e.target;

        // открытие аккордеона
        if (target.classList.contains('menu__item-title-block')) {
            const curItem = target.parentNode;

            if (curItem.classList.contains('menu__item--active')) {
                curItem.classList.remove('menu__item--active');
            } else {
                Array.from(menuitems).forEach(elem => {
                    elem.classList.remove('menu__item--active');
                });
                curItem.classList.add('menu__item--active');
            }
            return;
        }
        // закрытие аккордеона
        if (target.classList.contains('menu__close')) {
            let curItem = target.parentNode;

            while (curItem.tagName != 'LI') {
                curItem = curItem.parentNode;
            }

            curItem.classList.remove('menu__item--active');
            e.preventDefault();
        }
    });
};
VerticalAccordeon();

//мобильное меню 
let menuMobile = function () {
    const body = document.querySelector('body');

    const overlay = document.querySelector('.overlay');
    const btnmenu = document.querySelector('.button-nav__mobile');

    const nav = document.querySelector('.navigation').cloneNode(true);
    const logo = document.querySelector('.logo').cloneNode(true);
    const items = nav.querySelector('.navigation__list').children;

    //помещаем клоны в overlay
    overlay.children[0].appendChild(logo);
    overlay.children[0].appendChild(nav);

    // реккурсивная функция (для анимации)
    let counter = 0;
    function startMenuAnimation() {
        let elem = items[counter];
        elem.classList.toggle('slideInUpRight');
        counter++;
        if (counter < items.length) {
            setTimeout(startMenuAnimation, 100);
        }
        if (counter === items.length) {
            counter = 0;
        }
    }

    //клик по кнопке меню
    let isOpen = false;

    var btnmenu_click = btnmenu.addEventListener('click', e => {
        // устанавливаем положение меню в центре экрана
        const docHeight = document.documentElement.clientHeight;
        const listHeight = nav.querySelector('.navigation__wrapper').clientHeight;
        nav.style.height = `${docHeight}px`;

        if (isOpen) {
            isOpen = false;
            body.style.overflow = 'initial';
        } else {
            isOpen = true;
            body.style.overflow = 'hidden';
        }

        overlay.classList.toggle('active');
        overlay.children[0].style.top = `${window.pageYOffset}px`;
        btnmenu.classList.toggle('open');

        startMenuAnimation();
    });

    // клик по ссылке
    nav.addEventListener('click', e => {
        if (e.target.classList.contains('navigation__text')) {
            isOpen = false;
            overlay.classList.toggle('active');
            btnmenu.classList.toggle('open');
            body.style.overflow = 'initial';
            startMenuAnimation();
        }
    });
};
menuMobile();
//------------------------------
//--------- Модалка ------------
//------------------------------
let ModalWindowAJAXRequest = function () {
    const modal = (function () {
        const m = document.querySelector('.modal');
        let typemodal = 'm'; //по-умолчанию - тип модалки message 
        const p = m.querySelector('.modal__message-text');
        const a = m.querySelector('.button--modal');
        const reviewsName = m.querySelector('.reviews__name');
        const reviewsText = m.querySelector('.reviews__text');
        const btnCross = m.querySelector('.modal__message-btn-cross');

        // показываем в зависимости от типа модального окна
        let settype = function (type) {
            switch (type) {
                case 'm': //message
                    if (m.classList.contains('reviews')) m.classList.remove('reviews');
                    break;
                case 'r': //reviews
                    if (!m.classList.contains('reviews')) m.classList.add('reviews');
                    break;
                default: //по-умолчанию - тип message   
                    if (m.classList.contains('reviews')) m.classList.remove('reviews');
                    break;
            }
            typemodal = type;
        }

        // изменяем содержимое сообщения
        let setmessage = function (name = "", message) {
            if (typemodal !== 'r') {
                if (message) {
                    p.innerText = message;
                } else {
                    p.innerText = 'Неизвестная ошибка';
                }
            } else {
                if (name && message) {
                    reviewsName.innerHTML = name;
                    reviewsText.innerHTML = message;
                }
            }
        }

        // показываем модалку
        let showmodal = function () {
            m.style.display = 'block';
        };

        // закрытие окна по крестику
        btnCross.addEventListener('click', e => {
            e.preventDefault();
            m.style.display = 'none';
        });
        // закрытие окна по кнопке "Закрыть"
        a.addEventListener('click', e => {
            e.preventDefault();
            m.style.display = 'none';
        });
        // закрытие окна по щелчку вне окна
        m.addEventListener('click', e => {
            e.preventDefault();
            let curclass = e.target.className;
            if (curclass === "modal__container") {
                m.style.display = 'none';
            }
        });
        // закрытие окна по <ESC>
        document.addEventListener('keydown', e => {
            if (e.keyCode == 27) {
                m.style.display = 'none';
            }
        })

        return { set: settype, text: setmessage, show: showmodal };
    })();

    //-----------------------------
    //---------- Reviews ----------
    //-----------------------------

    const reviewsButtons = document.querySelectorAll('.reviews__button');
    
    for (button of reviewsButtons) {
        button.addEventListener('click', e => {
            e.preventDefault();
            const target = e.target;

            modal.set('r');
            modal.text(target.parentNode.parentNode.querySelector('.reviews__name').innerText, target.parentNode.parentNode.querySelector('.reviews__text').innerText);
            modal.show();
        });
    }


    //---------------------------
    //--------- AJAX ------------
    //---------------------------

    var form = document.querySelector('.form__wrapper');
    const buttonForm = form.querySelector('.button--form');

    buttonForm.addEventListener('click', e => {
        e.preventDefault();

        let email = "igor-rock@list.ru";
        let name = form.elements.name.value;
        let phone = form.elements.phone.value;
        let comment = form.elements.comment.value;

        let obj = new FormData(document.forms.formrequest);
        obj.append("name", name);
        obj.append("phone", phone);
        obj.append("comment", comment);
        obj.append("to", email);

        //валидация данных
        function validate() {
            let IsValidate = true;
            if (!validateField(form.elements.name)) IsValidate = false;
            if (!validateField(form.elements.phone)) IsValidate = false;
            if (!validateField(form.elements.comment)) IsValidate = false;
            if (validateEmail(email)) IsValidate = false;
            return IsValidate;
        }
        function validateEmail(email) {
            let i, errormessage;
            errormessage = '';
            checkA = false;
            for (i = 0; i < email.length; i++) {
                if (i == 0 && email[i] == '@') errormessage = 'Нет имени';
                if (i == email.length - 1 && email[i] == '@') errormessage = 'Нет доменного имени';
                if (email[i] == '@') checkA = true;
            }
            if (!checkA) errormessage = 'Заполните email в формате MYEMAIL@DOMEN.RU';
            return errormessage;
        }
        function validateField(field) {
            field.nextElementSibling.innerText = field.validationMessage;
            return field.checkValidity();
        }

        if (validate()) {
            // отправляем запрос на сервер
            const xhr = new XMLHttpRequest();
            xhr.open("POST", "https://webdev-api.loftschool.com/sendmail/");
            xhr.responseType = "json";
            xhr.setRequestHeader("X-Requested-With", "XMLHttpRequest"); //добавлям заголовок, чтобы не было ошибки 302       
            //xhr.send(JSON.stringify(obj));
            xhr.send(obj);
            modal.set('m');
            modal.text('', "Идет отправка данных. Подождите");
            modal.show();
            setTimeout(
                () => {
                    // запрос ответа от сервера
                    xhr.addEventListener('load', e => {
                        let message = xhr.response.message;
                        if (xhr.response.status >= 400) {
                            message += "\nОшибка:" + xhr.response.status;
                        } else {
                            message += "\nОтправка на сервер удалась!";
                        }
                        modal.set('m');
                        modal.text('', message);
                        modal.show();
                    });
                }, 2000
            );

        }
    });
};
ModalWindowAJAXRequest();
//ONE Page Scroll
$(document).ready(function () { //дождемся загрузки документа

    var md = new MobileDetect(window.navigator.userAgent), //Подключаем модуль определения устройства
        isMobile = md.mobile(); // в переменную isMobile попадет либо true либо false  


    let OnePageScroll = function () {

        let sections = $(".sections"), //найдем все секции
            content = $(".content"), //родителя-обертку
            position = 0, //для смещения            
            IsScroll = false, //для определения статуса прокрутки
            currItem = 0; //текущая секция
            
        const length = sections.length; //количество секций   

        //создадим динамически белые точки-навигации
        let createWhitedot = function (scrollto) {
            let LI = $("<li>");
            A = $("<a>", {
                attr: {
                    "href": "#"
                    //"data-scroll-to": `${scrollto}`                       
                }
            });

            LI.addClass("button-nav__item").attr("data-scroll-to", `${scrollto}`);
            A.addClass("button-nav__dot");
            LI.append(A);
            $(".button-nav__list").append(LI);  
        };
        let createDotnavigation = function(item) {
            let i = 0;
            for (i = 0; i < item; i++) {
                createWhitedot(i);
            }            
        };
        createDotnavigation(length);
        $(".button-nav__item").first().addClass("button-nav__item--active");        
/*
        // при ресайзе переопределяем высоту секции
        window.addEventListener('resize', function () {
            currHeight = parseFloat(sections.css("height"));
        }, true);
*/
        //определяем предыдущую и следующую секцию
        let defineSections = function (sections) {
            let section = sections.eq(currItem);
            return {
                next: section.next(),
                prev: section.prev()
            }
        }

        // функция прокрутки в зависомости от значения direction, определяем это значение через событие wheel ниже
        let scrollToSection = function (direction) {
            let section = defineSections(sections);
            //скроллим вниз
            if (direction === "up" && section.next.length) {
                performTransition(section.next.index());
                currItem++;
            }
            //спроллим вверх
            if (direction === "down" && section.prev.length) {
                performTransition(section.prev.index());
                currItem--;
            }
        };

        // функция смещения содержимого content по У
        let performTransition = function (index) {
            if (!IsScroll) {
                IsScroll = true;
                position = index * -100 + "%"; 
                //if ((parseFloat(position) * -1 <= contentHeight) && (parseFloat(position) * -1 >= 0)) { //если не зашли за пределы
                    content.css({
                        transform: `translateY(${position})`,
                        "-webkit-transform": `translateY(${position})`
                    });
                //}
                setTimeout(function () {
                    //Делаем задержку в 1s, пока функция setTimeout не выполнится inscroll будет равен true
                    IsScroll = false;

                    $(".button-nav__item")
                        .eq(index)
                        .addClass("button-nav__item--active")
                        .siblings()
                        .removeClass("button-nav__item--active");

                }, 1000); // подождать пока завершится инерция на тачпадах                
            }
        };

        // обработчик нажатий клавиш стрелки
        $(document).on("keydown", e => {
            //Обрабатываем нажатие клавиш вниз и вверх при этом проверяем крайние секции
            const section = defineSections(sections);

            switch (e.keyCode) {
                case 35: // клавиша End
                    if (section.next.length) {
                        currItem = length-1;
                        performTransition(currItem);
                    }
                    break;
                case 36: // клавиша Home
                    currItem = 0;
                    performTransition(currItem);                    
                    break;
                case 38, 33: // клавиша вверх или PageUp
                    if (section.prev.length) {
                        performTransition(section.prev.index());
                        currItem--;
                    }
                    break;
                case 40, 34: // клавиша вниз или PageDown
                    if (section.next.length) {
                        performTransition(section.next.index());
                        currItem++;
                    }
                    break;
            }
        });

        //обработчик прокрутки с помощью колеса мыши
        $(".wrapper").on({
            //по событию wheel в зависимости как изменяется deltaY мы понимаем прокрутили вверх колесиком или в низ.
            wheel: function (e) {
                const deltaY = e.originalEvent.deltaY;
                const direction = deltaY > 0 ? "up" : "down";
                //если прокруток было много, то вызовем только один раз функцию scrollToSection
                if (!IsScroll) scrollToSection(direction);
            },
            touchmove: e => e.preventDefault()
        });

        // разрешаем свайп на мобильниках
        if (isMobile) {
            $(window).swipe({
                swipe: (event, direction) => {
                    scrollToSection(direction);
                }
            });
        }

        // клики по кнопкам навигации
        $("[data-scroll-to]").on("click", e => {
            e.preventDefault();
            currItem = $(e.target).data("scroll-to");
            performTransition(parseFloat(currItem));            
        });



        performTransition(6);



    };
    OnePageScroll();
});
